width: 260px;
height: 67px;
background: #7AC751;
display: flex;
align-items: center;
justify-content: space-evenly;
`
export const Logo=styled.img`
height:14px;
width:18px;
`
export const Title=styled.div`
font-family: Rubik;
font-style: normal;
font-weight: 500;
font-size: 16px;
